import React, { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState([]);

  const fetchData = async (uri, token) => {
    try {
      const response = await fetch(uri, {
        headers: {
          Authorization: `Bearer ${token}`
        }
      });
      if (!response.ok) {
        throw new Error('Network response was not ok');
